pragma solidity ^0.6.0;

import './GX_RuleInterface.sol';
import '../Governance/GX_GovernanceAdmin.sol';
import './GX_TokenManager.sol';

/// @author Solidity Services
/// @title Galaxis: Rules for locking the fund
/// @notice Lock or unlock the fund
contract GX_Lock is GX_GovernanceAdmin, GX_TokenManager {

    /// @notice lock of the fund
    bool public isLocked;

    /// EVENTS: user facing events
    /// @notice event for locking or unlocking the token
    event GX_LockChanged(bool isLocked);

    /// CONSTRUCTOR
    constructor() public {
    }

    /// TRANSACTIONS

    /// @notice locking or unlocking the fund
    /// @dev ...
    /// @param _newLockValue new lock value
    function setLock(bool _newLockValue) public onlyAdmin {
        isLocked = _newLockValue;
        emit GX_LockChanged(_newLockValue);
    }

    /// @notice is it allowed to invest
    /// @dev ...
    function isAllowedDeposit(address _tknDeposit, uint _amount) public override virtual view returns (bool) {
        require((isLocked == false), "Galaxis: Fund is locked");
        super.isAllowedDeposit(_tknDeposit, _amount);
    }

    /// @notice is it allowed to withdraw
    /// @dev ...
    function isAllowedWithdraw(address _tknDeposit, uint _amount) public override virtual view returns (bool) {
        require((isLocked == false), "Galaxis: Fund is locked");
        super.isAllowedWithdraw(_tknDeposit, _amount);
    }

    /// @notice is it allowed to trade
    /// @dev ...
    function isAllowedPlaceOrder() public override virtual view returns (bool) {
        require((isLocked == false), "Galaxis: Fund is locked");
        super.isAllowedPlaceOrder();
    }
    /// VIEWS

}

